import React from 'react'
import './Navigation.css'

const Navigation = ()=>{
	return(
		<div className="nav_bar">
			<nav>
			 	<input value='Sign Out' className='poiner f3 link black underline pa3' type='submit'/> 
			 </nav>
		</div>
	)
}

export default Navigation;
